import React from "react";
import propTypes from "prop-types";

import * as Styled from "styled-components";

export const Order = {
  left: "flex-start",
  center: "center",
  right: "flex-end",
  between: "space-between",
};

const List = ({ children, order = Order.left }) => {
  return <Styled.List order={order}>{children}</Styled.List>;
};

List.propTypes = {
  children: propTypes.node.isRequired,
};

export default List;
